import React from 'react';
import { StyleSheet, } from 'react-native';
import MainScreen from './src/components/screens/MainScreen';
import { createStackNavigator } from '@react-navigation/stack';
import { NavigationContainer } from '@react-navigation/native';
import SubScreen from './src/components/screens/SubScreen';


export default function App() {

  const Stack = createStackNavigator();

  return (
    <NavigationContainer style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Stack.Navigator>
        <Stack.Screen name="My first Page" component={MainScreen} />
        <Stack.Screen name="SubScreen" component={SubScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  tinyLogo: {
    width: 100,
    height: 100,
  },
  input: {
    height: 40,
    margin: 12,
    borderWidth: 1,
    padding: 10,
  },
});
